import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <>
      <Container>
        <Row>
          <Col>
          <div className="footer-style">&#9827; 2022 - Angelo Fantino</div>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Footer;
